const Cards = () => {
  return (
    <>
      <CardContainer>
        <CardTop>
          <CardDot />
          <CardDot />
          <CardDot />
          <CardBar />
        </CardTop>
      </CardContainer>
      <CardContainer>
        <CardTop>
          <CardDot />
          <CardDot />
          <CardDot />
          <CardBar />
        </CardTop>
      </CardContainer>
    </>
  );
};

export default Cards;
